import React from 'react'
import './css/card.css';
import { NavLink } from 'react-router-dom';

function Card(item) {

  
  return (
    <div>
    <NavLink to={item.textval}  className='Side'>
    <div className="side">
        <img src={item.val} className='pic' alt="error" /> 
        <p className='side1'>{item.textval} </p>
    </div>
    </NavLink>
    </div>
  );
}

export default Card;
